import React from "react";
import HeaArrow from "../../components/HeaArr";

const Profile = () => {
  return (
    <div>
      <HeaArrow />
      <h6>Casa</h6>
      <p
        style={{
          fontFamily: "GothamBook",
          fontSize: "12px",
        }}
      >
        Calle Pedro Moreno no.24, Colonia Lindavista
      </p>
    </div>
  );
};

export default Profile;
